        function togglePlot(plotId) {
            var plotDiv = document.getElementById(plotId);
            if (plotDiv.style.display === "none") {
                plotDiv.style.display = "block";
            } else {
                plotDiv.style.display = "none";
            }
        }
    </script>
</body>
</html>
